  return (
    <div className={s.pokeCard}>
        <Link to={`/pokemons/id`}><h2>Name</h2></Link>
        {/*<img src={props.image} alt={props.name} />*/}
      
    <button>Update</button>
    <button>Delete</button>
    </div>
  )
}
